&lt;p&gt;Read the given statements and conclusions carefully. Assuming that the information given in the statements in true, even if it appears to be at variance with commonly known facts, decide which of the given conclusions logically follow(s) from the statements.&lt;/p&gt;

&lt;p&gt;&lt;strong&gt;Statements:&lt;/strong&gt;&lt;/p&gt;

&lt;p&gt;1. Some dancers are writers.&lt;/p&gt;

&lt;p&gt;2. All writers are students.&lt;/p&gt;

&lt;p&gt;&lt;strong&gt;Conclusions:&lt;/strong&gt;&lt;/p&gt;

&lt;p&gt;I. Some students are dancers.&lt;/p&gt;

&lt;p&gt;II. Some students are writers.&lt;/p&gt;
III. No students is a dancer.

